import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Planets from './Pages/Planet/Planets';
import PlanetDetails from './Pages/Planet/PlanetDetails';
import './App.css';

const App = () => {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" exact component={Planets} />
          <Route path="/planet/:id" component={PlanetDetails} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
